import React from 'react';
import { Menu } from 'antd';

const DropdownUser = () => (
  <Menu>
    <Menu.Item key="0">
      <a href="http://www.alipay.com/">Your Profile</a>
    </Menu.Item>
    <Menu.Item key="1">
      <a href="http://www.taobao.com/">Your Shop</a>
    </Menu.Item>
    <Menu.Divider />
    <Menu.Item key="3">Log out</Menu.Item>
  </Menu>
);

export default DropdownUser;
